import React from "react";
import {Route, Switch} from 'react-router';

/**
 * Import all page components
 */
import App from './components/App'
import Main from './components/Main'

/**
 * All routes go here
 */
export default (
    <Switch>
        <Route exact path="/" component={Main}/>
    </Switch>
);
